webpackJsonp([2460261286554],{7780:function(e,t){e.exports={data:{post:{html:'<p>That Hillary Clinton is running for President is about as surprising as the Pope being Catholic or the bear shitting in the woods, but the German press isn\'t very well informed on US politics, so she\'s been the big news here for past day. Her picture even <a href="http://www.welt.de/data/2007/01/20/1184167.html">made the the front page</a> of the conservative Welt am Sonntag (which we only read for the real estate ads). The online edition is even running a story about <a href="http://www.welt.de/data/2007/01/21/1184198.html">Hillary\'s alter-ego</a>, so I guess they\'re paying some attention.</p>\n<p>Of course to truly make sense of American politics we have to turn to an analyst like Scott Adams, who today <a href="http://dilbertblog.typepad.com/the_dilbert_blog/2007/01/flipflopper_sea.html">explains</a> why we punish politicians for acting rational and why he already feels good about a Clinton/Obama ticket. Hey, it makes me feel good too!</p>',fields:{title:"Billary Returns",date:"21 Jan 2007",url:"https://papascott.de/2007-01-21-billary-returns/"}}},pathContext:{slug:"/2007-01-21-billary-returns/",prev:{fields:{title:"King Stoiber Abdicates",date:"18 Jan 2007",slug:"/2007-01-18-king-stoiber-abdicates/"}},next:{fields:{title:"City of Books and Pillows",date:"21 Jan 2007",slug:"/2007-01-21-city-of-books-and-pillows/"}}}}}});
